import React from 'react';
import { useNavigate } from 'react-router-dom';
import './cat.css';

const Category = () => {
  const navigate = useNavigate();

  const handleBack = () => {
    navigate('/FoodDetails');
  };

  return (
    <div className="category-container">
      <button className="back-button" onClick={handleBack}>&lt;</button>
      <div className="header">
        <div className="food-info">
          <h4>
            Fast <br />
            <span>Food</span>
          </h4>
          <p>80 types of pizza</p>
        </div>
        <img src="/asset/pizza.png" alt="Pizza" className="pizza-image" />
      </div>
      <div className="sort-section">
        <p>Sort by</p>
      </div>
      <div className="food-item">
        <img src="/asset/ball (2).png" alt="Chicken Hawaiian" className="food-image" />
        <p>
          Chicken Hawaiian <br />
          Chicken, Cheese, and Pineapple
        </p>
      </div>
      <div className="food-item">
        <img src="/asset/ball (1).png" alt="Other Food Item" className="food-image" />
      </div>
    </div>
  );
};

export default Category;
